import React from 'react';


export default function Widget() {
    return (
      <div className="widget">
        <div class="widget">
          <div className="left-panel panel">
            <div className="date">Latest Data Received</div>
            <div className="city">Temp.</div>
            <div className="temp">
              27&deg;
            </div>
          </div>
        </div>
      </div>
    );
}
